// import  React from "react";

import { useEffect } from "react";

import Footer from "../../components/footer/footer";
import "./style.css";
import { Navbartest } from "../../components/navbartest/navbartest";
// import './scripts.js';
import { Button, CssBaseline, Grid } from "@material-ui/core";
import logo from "../../assets/img/COD_LOGOvs2.png";
import AOS from "aos";
import "aos/dist/aos.css";
import clsx from "clsx";
import {
  createMuiTheme,
  createStyles,
  withStyles,
  makeStyles,
  Theme,
  ThemeProvider,
} from "@material-ui/core/styles"; // import classes from "*.module.css";

// import React, { CSSProperties } from "react";

function Home_test(): JSX.Element {
  useEffect(() => {
    AOS.init({ duration: 3000 });
    AOS.refresh();
  }, []);

  const styles = {
    btn: {
      background: "linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)",
      borderRadius: 3,
      border: 0,
      color: "white",
      height: 48,
      padding: "0 30px",
      boxShadow: "0 3px 5px 2px rgba(255, 105, 135, .3)",
    },
  };

  return (
    <>
      {/* <!-- ======= Header ======= --> */}
      {/* <Header /> */}
      <CssBaseline />
      <Navbartest />
      <div className="bloco-externo">
        <Grid container spacing={2} className="bloco-img">
          <Grid item xs={6} sm={6}>
            <img src={logo} className="animated" alt=""></img>
          </Grid>
          <Grid item xs={12} sm={6}>
            <Grid container spacing={3}>
              <Grid
                item
                xs={12}
                justify="center"
                className="bloco-externo-title"
              >
                <h1>Campus On Demand</h1>
                <h3>alguma descrição legal aqui.</h3>
              </Grid>
              <Grid item xs={12} alignContent="center"></Grid>
              <Grid
                item
                xs={12}
                alignContent="center"
                className="bloco-externo-title"
              >
                <div>
                  <Button className={clsx(classes.btn)}>teste</Button>
                  );
                </div>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </div>
      <Footer />
    </>
  );
}

export default Home_test;
